import React, { useState } from 'react';
import { View, Text, StyleSheet, TouchableOpacity, TextInput } from 'react-native';
import { StatusBar } from 'expo-status-bar';
import * as Animatable from 'react-native-animatable';
import { LinearGradient } from 'expo-linear-gradient';
import Axios from 'axios';
import Logo from '../components/Logo';

export default function LoginScreen({ navigation }) {
  const [state, setState] = useState({
    username: '',
    password: '',
    isValidUser: true,
    isValidPassword: true,
  });

  const textUsernameChange = (val) => {
    if (val.length >= 4) {
      setState({
        ...state,
        username: val,
        isValidUser: true,
      });
    } else {
      setState({
        ...state,
        username: val,
        isValidUser: false,
      });
    }
  };

  const handlePasswordChange = (val) => {
    if (val.length >= 6) {
      setState({
        ...state,
        password: val,
        isValidPassword: true,
      });
    } else {
      setState({
        ...state,
        password: val,
        isValidPassword: false,
      });
    }
  };

  const resetTextFields = () => {
    setState({
      ...state,
      username: '',
      password: '',
      isValidUser: true,
      isValidPassword: true,
    });
  };

  const LoginData = async () => {
    console.log("username", state.username);
    console.log("password", state.password);

    try {
      const response = await Axios.post("http://localhost:8000/data/signin", {
        username: state.username,
        password: state.password,
      });

      if (response.data.status === "success") {
        await AsyncStorage.setItem('isLoggedIn', 'true');
        await AsyncStorage.setItem('userData', JSON.stringify(response.data));
        navigation.push("Dashboard", { username: state.username });
        resetTextFields();
      } else {
        alert("Username and Password do not match");
      }
    } catch (error) {
      alert("Unsuccessful attempt");
      console.error(error);
    }
  };

  return (
    <View style={styles.container}>
      <StatusBar style="auto" />
      <Animatable.View animation="rubberBand" duration={1000}>
        <View style={styles.data}>
          <Logo style={styles.logo} />
          <Text style={styles.header}>Login to Your Account</Text>
          <TextInput
            placeholder="Username"
            style={styles.username}
            onChangeText={(e) => textUsernameChange(e)}
          />
          {!state.isValidUser && (
            <Animatable.Text
              animation="fadeInLeft"
              duration={500}
              style={styles.error}
            >
              Username should be 4 characters long
            </Animatable.Text>
          )}
          <TextInput
            secureTextEntry
            placeholder="Password"
            style={styles.username}
            onChangeText={(e) => handlePasswordChange(e)}
          />
          {!state.isValidPassword && (
            <Animatable.Text
              animation="fadeInLeft"
              duration={500}
              style={styles.error}
            >
              Password should be 6 characters long
            </Animatable.Text>
          )}
          <TouchableOpacity onPress={() => navigation.navigate('ResetPasswordScreen')}>
            <Text style={styles.forgotPassword}>Forgot Password?</Text>
          </TouchableOpacity>
          <TouchableOpacity>
            <LinearGradient colors={['#fa7268', '#f45149']} style={styles.loginButton}>
              <Text style={styles.buttonText} onPress={LoginData}>
                Login
              </Text>
            </LinearGradient>
            <Text style={styles.signup} onPress={() => navigation.navigate('RegisterScreen')}>
              Don't have an account? Sign Up
            </Text>
          </TouchableOpacity>
        </View>
      </Animatable.View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f8f8f8',
  },
  data: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  logo: {
    width: 150,
    height: 150,
  },
  header: {
    fontSize: 20,
    fontWeight: 'bold',
    marginTop: 20,
    color: '#333',
  },
  username: {
    padding: 15,
    borderBottomColor: '#ccc',
    borderBottomWidth: 1,
    width: '80%',
    fontSize: 16,
    marginBottom: 10,
  },
  error: {
    color: '#f45149',
    fontSize: 14,
    paddingLeft: 10,
  },
  loginButton: {
    justifyContent: 'center',
    alignItems: 'center',
    marginTop: 20,
    padding: 15,
    width: '80%',
    borderRadius: 10,
  },
  buttonText: {
    fontSize: 18,
    color: 'white',
    fontWeight: 'bold',
  },
  forgotPassword: {
    color: '#333',
    fontSize: 14,
    paddingTop: 10,
  },
  signup: {
    color: '#333',
    fontSize: 16,
    paddingTop: 10,
  },
});
